o get back out on the rock and altitude. An appreciation that I didn’t realise I had now I can physically climb it’s come apparent that I am holding on to a fear or not ready to go back to a place I am not sure I want to revisit yet or have dealt with from my experience on Everest.....a time where humanity let me down and trust was lost... luckily the good of humanity outweighs the bad, nonetheless getting back out there is starting to seem harder than it should be. It’s where I belong and where I love being. I know I will be back there just a little more time is what I need and to keep being amongst people I love and trust xxx #mountaingoatyogi #walk #freedom #compassion #friends #training #love #gratitude #nevergiveup #neverstopexploring #hiking #mountaineering #running #loveyourbody #meditation 🏃🏽‍♀️🏋🏽‍♂️🧘🏽‍♀️🧗🏽♥️🌈💫🌎";}i:173;a:1:{s:14:"comments_count";i:1;}i:174;a:1:{s:11:"likes_count";i:8;}i:175;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEunyJHl5PF";}i:176;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118696130_201409771416181_103526729523029606_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=ksBtc7IGxPUAX8jpIS6&oh=84b53c6ef2f77f05696f9a5745ce25c2&oe=5F7CAA86";}i:177;a:1:{s:4:"type";s:7:"sidecar";}i:178;a:1:{s:8:"owner_id";i:10469478976;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2391023234316023420";}i:183;a:1:{s:10:"short_code";s:11:"CEunvajHLZ8";}i:184;a:1:{s:12:"created_time";i:1599252206;}i:185;a:1:{s:7:"caption";s:392:"#salamon #k #digimonadventure #digimon #garmin #moon #listasmon #discotecamoonmadrid #moonmadrid #listamonmadrid #rrppmoon #discotecapenelope #relacionesmoon #relacionesmon #rrppmon #listasmonmadrid #listadiscotecamon #listasdiscotecamon #penelopemadrid #discotecamoon #fiestasmon #discotecamonmadrid #flyermon #cklich #listamon #fiestadiscotecamon #fiestasdiscotecamon #mo