246;a:1:{s:9:"owner_pic";s:0:"";}i:247;a:1:{s:2:"id";s:19:"2391022124444629570";}i:248;a:1:{s:10:"short_code";s:11:"CEunfQ5nzpC";}i:249;a:1:{s:12:"created_time";i:1599252070;}i:250;a:1:{s:7:"caption";s:1020:"It’s been almost a full week since I’ve posted on my grid. It’s been crazy. Third week of virtual learning, but found out one of my 3 kiddos hadn’t been doing most of his assignments, so every spare minute has been spent catching him up. #virtuallearning #thankscovid19 

However, I HAVE been making my own health priority by doing my daily workouts (last week of #mbfa 🙌🏻), and walking 3-4 miles (Sunday I had 6mi). Still eating #vegan / #vegetarianrecipes and trying new ones, too. Self care is sooo important when you’re being pulled in every direction. 🤯😘

This morning, I had the pleasure of walking with my sweet friend and having some conversation that wasn’t about work or school. It was lovely. I am learning that everything is a season and this psycho crazy one won’t be forever. #thankyoujesus Also, my color coordination brought me such JOY today. 😂❤️😊

So happy for our 3 DAY WEEKEND!!! Couldn’t have come at a better time. How about you? Are you surviving the crazy???";}i:251;a:1:{s:14:"comments_count";i:1;}i:252;a:1:{s:11:"likes_count";i:8;}i:253;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEunfQ5nzpC";}i:254;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118764966_315892433028430_8857591743599671259_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=rJrRySVnwuoAX_fEBh4&oh=bdabfce094a5d4a9a98796847730dc18&oe=5F7A65B0";}i:255;a:1:{s:4:"type";s:7:"sidecar";}i:256;a:1:{s:8:"owner_id";i:4515443254;}i:257;a:1:{s:14:"owner_username";s:0:"";}i:258;a:1:{s:14:"owner_fullname";s:0:"";}i:259;a:1:{s:9:"owner_pic";s:0:"";}}